  &quot;_id&quot;: 1
  &quot;firstname&quot;: &quot;John&quot;
  &quot;lastname&quot;: &quot;Doe&quot;
  &quot;address&quot;: {
    &quot;street&quot;: &quot;13&quot;,
    &quot;city&quot;: &quot;Los Angeles&quot;,
    &quot;state&quot;: &quot;California&quot;,
    &quot;country&quot;: &quot;USA&quot;,
    &quot;pincode&quot;: &quot;12345&quot;
  }
}
</code></pre>
<p><strong>I want to make an API that will update the user data.</strong></p>
