<p>Using this method some fields are being removed from collection which are not present in request.</p>
<p><strong>Query:</strong></p>
<pre><code>const updateUser = (userId, data) =&gt; {
    return UserDB.updateOne({ _id: userId }, {
        $set: {...data }
    });
};
</code></pre>
<p><strong>Request:</strong></p>
<pre><code>{
  &quot;_id&quot;: 1
  &quot;firstname&quot;: &quot;Justin&quot;
  &quot;lastname&quot;: &quot;Thomas&quot;
  &quot;address&quot;: {
    &quot;country&quot;: &quot;Canada&quot;,
    &quot;pincode&quot;: &quot;9999&quot;
  }
}
</code></pre>
<p><strong>Result:</strong></p>
<pre><code>// street, city and state is removed from collection
{
  &quot;_id&quot;: 1
  &quot;firstname&quot;: &quot;Justin&quot;
  &quot;lastname&quot;: &quot;Thomas&quot;
  &quot;address&quot;: {
    &quot;country&quot;: &quot;Canada&quot;,
    &quot;pincode&quot;: &quot;9999&quot;
  }
}
</code></pre>
