<p>Using this method, fields are set to null which are not present in the request.</p>
<p><strong>Query:</strong></p>
<pre><code>const updateUser = (userId, data) =&gt; {
    return UserDB.updateOne({ _id: userId }, {
        $set: {
            &quot;firstname&quot;: data.firstname,
            &quot;lastname&quot;: data.lastname,
