            &quot;address.pincode&quot;: data.address.pincode
        }
    });
};
</code></pre>
<p><strong>Request:</strong></p>
<pre><code>{
  &quot;_id&quot;: 1
  &quot;firstname&quot;: &quot;Justin&quot;
  &quot;lastname&quot;: &quot;Thomas&quot;
  &quot;address&quot;: {
    &quot;country&quot;: &quot;Canada&quot;,
    &quot;pincode&quot;: &quot;9999&quot;
  }
}
</code></pre>
<p><strong>Result:</strong></p>
<pre><code>// street, city and state is set to null in the collection.
{
  &quot;_id&quot;: 1
  &quot;firstname&quot;: &quot;Justin&quot;
  &quot;lastname&quot;: &quot;Thomas&quot;
  &quot;address&quot;: {
    &quot;street&quot;: null,
    &quot;city&quot;: null,
