updateOne nested Array in mongodb<p>I have a group collection that has the array <code>order</code> that contains ids.
I would like to use <code>updateOne</code> to set multiple items in that order array.</p>
<p>I tried this which updates one value in the array:</p>
<pre><code>db.groups.updateOne({
    _id: '831e0572-0f04-4d84-b1cf-64ffa9a12199'
  },
  {$set: {'order.0': 'b6386841-2ff7-4d90-af5d-7499dd49ca4b'}}
)
</code></pre>
<p>That correctly updates (or sets) the array value with index 0.</p>
<p>However, I want to set more array values and updateOne also supports a pipeline so I tried this:</p>
<pre><code>db.slides.updateOne({
    _id: '831e0572-0f04-4d84-b1cf-64ffa9a12199'
  },
  [
    {$set: {'order.0': 'b6386841-2ff7-4d90-af5d-7499dd49ca4b1'}}
  ]
)
</code></pre>
<p>This does NOTHING if the order array is empty. But if it's not, it replaces every element in the order array with an object <code>{ 0: 'b6386841-2ff7-4d90-af5d-7499dd49ca4b1' }</code>.
I don't understand that behavior.</p>
<p>In the optimal case I would just do</p>
<pre><code>db.slides.updateOne({
    _id: '831e0572-0f04-4d84-b1cf-64ffa9a12199'
  },
  [
    {$set: {'order.0': 'b6386841-2ff7-4d90-af5d-7499dd49ca4b1'}},
    {$set: {'order.1': 'otherid'}},
    {$set: {'order.2': 'anotherone'}},
  ]
)
</code></pre>
<p>And that would just update the order array with the values.</p>
<p>What is happening here and how can I achieve my desired behavior?</p>

