Why am I getting createIndex deprecation error?<p>So I am using TypeScript to build an <code>express</code> server using <code>mongoose</code> to interact with <code>MongoDB Atlas</code>. Recently I decided to use multiple databases inside my app and change up my schemas to accommodate this new &quot;architecture&quot;. However doing so made a <code>deprecation warning</code> appear:</p>
<blockquote>
<p>(node:2096) DeprecationWarning: collection.ensureIndex is deprecated. Use createIndexes instead.
(Use <code>node --trace-deprecation ...</code> to show where the warning was created)</p>
</blockquote>
<p>I have already pinpointed where the error is happening. It is happening when I map the schema to a mongoose model.</p>
<p><strong>Implementation code where error does occur:</strong></p>
<pre><code>const db = mongoose.connection.useDb(&quot;Authentication&quot;);
const User = db.model&lt;UserInterface&gt;(&quot;User&quot;, UserSchema);
</code></pre>
<p><strong>Implementation code where error does NOT occur:</strong></p>
<pre><code>const User = mongoose.model&lt;UserInterface&gt;(&quot;User&quot;, UserSchema);
</code></pre>
<p><strong>Here is my connection logic to mongodb:</strong></p>
<pre><code>import mongoose from &quot;mongoose&quot;;

async function connect() {
   try {
      const uri = &lt;string&gt;process.env.MONGO_URI;
      await mongoose.connect(uri, {
         useNewUrlParser: true,
         useUnifiedTopology: true,
         useCreateIndex: true,
      });
      console.log(&quot;MongoDB Connected...&quot;);
      return;
   } catch (err) {
      process.exit(1);
   }
}

export default connect;
</code></pre>
<p>As you can see I already have <code>useCreateIndex: true</code> so I don't know why the error is occuring. <strong>The error does go away</strong> when I add this to the schema but I don't think its a good solution:</p>
<pre><code>{ timestamps: true, autoIndex: false }
</code></pre>
<p>So what am I doing wrong here? Thank You!</p>

